mutation UpdateRouterAllAccessPoints($input: UpdateRouterAllAccessPointsInput!) {
  updateRouterAllAccessPoints(input: $input) {
    accessPoints {
      id
      ssid
      securityMode
      password
      radios {
        frequencyBand
        channel
        operatingStandards
        __typename
      }
      __typename
    }
    equipmentId
    __typename
  }
}
